import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { FirstComponent } from './first/first.component';
import { AProposComponent } from './a-propos/a-propos.component';
import { FormsModule } from '@angular/forms';
import { InscriptionComponent } from './inscription/inscription.component';
import { NavbarComponent } from './navbar/navbar.component';
import { FooterComponent } from './footer/footer.component';
import { InscriptionClientComponent } from './inscription-client/inscription-client.component';
import { AjoutAnnonceComponent } from './ajout-annonce/ajout-annonce.component';
import { ModifierAnnonceComponent } from './modifier-annonce/modifier-annonce.component';
import { ConnecterComponent } from './connecter/connecter.component';
import { AcceuilComponent } from './accueil/accueil.component';
import { AgenceComponent } from './agence/agence.component';
import { AnnoncePourAgComponent } from './annonce-pour-ag/annonce-pour-ag.component';
import { AnnoncePourClComponent } from './annonce-pour-cl/annonce-pour-cl.component';
import { AgencePourAgComponent } from './agence-pour-ag/agence-pour-ag.component';


@NgModule({
  declarations: [
    AppComponent,
    FirstComponent,
    AProposComponent,
    InscriptionComponent,
    NavbarComponent,
    FooterComponent,
    InscriptionClientComponent,
    AjoutAnnonceComponent,
    ModifierAnnonceComponent,
    ConnecterComponent,
    AccueilComponent,
    AgenceComponent,
    AnnoncePourAgComponent,
    AnnoncePourClComponent,
    AgencePourAgComponent,

  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
